private OccupantInfo parseOccupantInfo(XmlPullParser parser) throws Exception {

  boolean done = false;
  String jid = null;
  String nickname = null;
  Date joined = null;
  while (!done) {
    int eventType = parser.next();
    if ((eventType == XmlPullParser.START_TAG) && ("jid".equals(parser.getName()))) {
      jid = parser.nextText();
    } else if ((eventType == XmlPullParser.START_TAG)
        && ("nickname".equals(parser.getName()))) {
      nickname = parser.nextText();
    } else if ((eventType == XmlPullParser.START_TAG) && ("joined".equals(parser.getName()))) {
      joined = UTC_FORMAT.parse(parser.nextText());
    } else if (eventType == XmlPullParser.END_TAG && "occupant".equals(parser.getName())) {
      done = true;
    }
  }
  return new OccupantInfo(jid, nickname, joined);
}

private Object parse_simple_value(FieldDefinition f, String s) {

  if (s.equalsIgnoreCase(NULL_VALUE)) return null;
  switch (f.getBaseType()) {
    case Types.TYPE_BOOLEAN:
      return Boolean.parseBoolean(s);
    case Types.TYPE_LONG:
      return Long.parseLong(s);
    case Types.TYPE_INT:
      return Integer.parseInt(s);
    case Types.TYPE_DOUBLE:
      return Double.parseDouble(s);
    case Types.TYPE_FLOAT:
      return Float.parseFloat(s);
    case Types.TYPE_STRING:
    case Types.TYPE_TEXT:
      return s;
    case Types.TYPE_DATE:
      try {
        return spreadsheet_date_formatter.parse(s);
      } catch (ParseException e1) {
        e1.printStackTrace();
        return null;
      }
    case Types.TYPE_BLOB:
      return Byte.parseByte(s);
    case Types.TYPE_REFERENCE:
      Entity e = new Entity();
      String[] type_id = s.split(":");
      e.setType(type_id[0]);
      e.setId(Long.parseLong(type_id[1]));
      return e;
    default:
      return s;
  }
}

private Date extractGmt(String s) {
  final SimpleDateFormat timeFormat;
  if (s.matches("\\d{4}/\\d{2}/\\d{2} \\d{2}:\\d{2}:\\d{2}")) {
    timeFormat = new SimpleDateFormat("yyyy/MM/dd HH:mm:ss");
  } else if (s.matches("\\d{4}/\\d{2}/\\d{2} \\d{2}:\\d{2}")) {
    timeFormat = new SimpleDateFormat("yyyy/MM/dd HH:mm");
  } else {
    throw new UnsupportedOperationException(s);
  }
  timeFormat.setTimeZone(TimeZone.getTimeZone("GMT"));
  try {
    return timeFormat.parse(s);
  } catch (ParseException e) {
    throw new UnsupportedOperationException(s);
  }
}

