          .createHistoricTaskInstanceQuery()
          .taskDescriptionLike("%task description")
          .count());
  assertEquals(
      1,
      historyService
          .createHistoricTaskInstanceQuery()
          .taskDescriptionLike("Historic task %")
          .count());
  assertEquals(
      1, historyService.createHistoricTaskInstanceQuery().taskDescriptionLike("%task%").count());
  assertEquals(
