    try {
      d1 = new DateTime(formatter.parse(otherDate));
    } catch (ParseException e) {
      // TODO Auto-generated catch block
      e.printStackTrace();
    }
  } else {
    d1 = ISODateTimeFormat.dateTimeNoMillis().parseDateTime(otherDate);
  }
