private double parseDateToDouble(SimpleDateFormat dateFormat, String date, double defaultValue) {
  if (date == null) {
    return defaultValue;
  }
  try {
    Date d = dateFormat.parse(date);
    Calendar cal = Calendar.getInstance();
    cal.setTime(d);
    return cal.getTimeInMillis();
  } catch (Exception ex) {
    return defaultValue;
  }
}

