/**
 * Ê†πÊçÆÁ±ªÂûãÔºåÂèçÂ∞ÑË∞ÉÁî®setterÊñπÊ≥ï.
 *
 * @param entity ÂÆû‰æã
 * @param writeMethod setterÊñπÊ≥ï
 * @param propertyType Êï∞ÊçÆÁ±ªÂûã
 * @param propertyValue Êï∞ÊçÆÂÄº
 * @param datePattern Êó•ÊúüÊ†ºÂºè
 * @throws Exception ÂºÇÂ∏∏
 */
public static void invokeWriteMethod(
    Object entity,
    Method writeMethod,
    Class propertyType,
    String propertyValue,
    String datePattern)
    throws Exception {
  if (isPrimivite(propertyType)) {
    invokePrimivite(entity, writeMethod, propertyType, propertyValue);
  } else if (propertyType == String.class) {
    writeMethod.invoke(entity, propertyValue);
  } else if (propertyType == Date.class) {
    SimpleDateFormat dateFormat = getDateFormat(datePattern);

    writeMethod.invoke(entity, dateFormat.parse(propertyValue));
  }
}

