private boolean isValid(String dateString, String pattern) {
  boolean valid = true;
  Date date;
  SimpleDateFormat sdf = new SimpleDateFormat(pattern);
  sdf.setLenient(false);
  try {
    dateString = dateString.trim();
    date = sdf.parse(dateString);
    Calendar calendar = Calendar.getInstance();
    calendar.setTime(date);
    int year = calendar.get(Calendar.YEAR);
    int era = calendar.get(Calendar.ERA);
    if (era == GregorianCalendar.AD) {
      if (year > 9999) {
        valid = false;
      }
    }
    // System.out.println("pattern is "+ pattern);
    // System.out.println("Year is "+year);
    // System.out.println("Calendar date is "+date.toString());
    // System.out.println("Era is "+calendar.get(Calendar.ERA));
  } catch (ParseException e) {
    valid = false;
  }
  if (dateString.length() > pattern.length()) {
    valid = false;
  }
  return valid;
}

public static synchronized int decodeTime(String s) throws Exception {
  SimpleDateFormat f = new SimpleDateFormat("HH:mm:ss");
  // System.out.println("Passed in this time " +s);
  TimeZone utcTimeZone = TimeZone.getTimeZone("UTC");
  f.setTimeZone(utcTimeZone);
  f.setLenient(false);
  ParsePosition p = new ParsePosition(0);
  Date d = f.parse(s, p);
  if (d == null || !StringUtil.isRestOfStringBlank(s, p.getIndex())) {
    throw new Exception("Invalid time value (hh:mm:ss): \"" + s + "\".");
  }
  return (int) d.getTime();
}

