/**
 * Converts from "yyyyMMdd'T'HHmmss'Z'" to "yyyyMMdd'T'HHmmss" using the timezone ID. If the given
 * date is in standard allday format 'yyyyMMdd', no convertion is needed. If it is in not standard
 * allday format 'yyyy-MM-dd', it's needed to remove the '-'.
 *
 * @param patternDate the date to convert
 * @param tmzid the timezone id to use in the convertion
 * @return String the converted date in local time
 * @throws com.funambol.json.exception.JsonConversionException
 */
private String zuluToLocalConversion(String patternDate, String tmzid)
    throws JsonConversionException {

  String output = null;

  try {

    if (patternDate == null) {
      return output;
    }

    String dateFormat = Utility.getDateFormat(patternDate);

    if ("yyyyMMdd".equals(dateFormat)) {
      return patternDate;
    }

    if ("yyyy-MM-dd".equals(dateFormat)) {
      return patternDate.replaceAll("-", "");
    }

    if ("yyyyMMdd'T'HHmmss".equals(dateFormat) && patternDate.matches(".*T000000")) {
      // if "Z" is not specified and HHmmss == 000000 then it is an all-day
      // See bug #6724
      return patternDate.replace("T000000", "");
    }

    SimpleDateFormat ZULU_DATE_FORMATTER = new SimpleDateFormat("yyyyMMdd'T'HHmmss'Z'");
    ZULU_DATE_FORMATTER.setTimeZone(TimeZone.getTimeZone("UTC"));
    Date datePatterDate = ZULU_DATE_FORMATTER.parse(patternDate);

    SimpleDateFormat LOCAL_DATE_FORMATTER = new SimpleDateFormat("yyyyMMdd'T'HHmmss");
    LOCAL_DATE_FORMATTER.setTimeZone(TimeZone.getTimeZone(tmzid));
    output = LOCAL_DATE_FORMATTER.format(datePatterDate);
  } catch (ParseException pe) {
    throw new JsonConversionException(
        "Error in the zuluToLocalConversion." + pe.getMessage(), pe);
  }

  return output;
}

protected void doEdit(RenderRequest request, RenderResponse response)
    throws PortletException, IOException {
  try {
    Connection db = PortalUtils.useConnection(request);
    Project thisProject = PortalUtils.getProject(request);

    // Get the categories for the user
    TaskCategoryList categoryList = new TaskCategoryList();
    categoryList.setProjectId(PortalUtils.getProject(request).getId());
    categoryList.buildList(db);
    request.setAttribute("categoryList", categoryList);
    request.setAttribute("categoryId", request.getPreferences().getValue("categoryId", "-1"));

    // Get the date
    Date startDate = new Date(System.currentTimeMillis());
    String startDateValue = request.getPreferences().getValue("startDate", null);
    if (startDateValue != null) {
      SimpleDateFormat formatter = new SimpleDateFormat("MM/dd/yyyy");
      try {
        startDate = formatter.parse(startDateValue);
      } catch (Exception e) {

      }
    }
    request.setAttribute("startDate", startDate);

    // Show the releases
    ProjectItemList targetReleaseList = new ProjectItemList();
    targetReleaseList.setProjectId(thisProject.getId());
    targetReleaseList.setEnabled(Constants.TRUE);
    targetReleaseList.buildList(db, ProjectItemList.LIST_TARGET_RELEASE);
    request.setAttribute("releaseList", targetReleaseList);
    request.setAttribute("releaseId", request.getPreferences().getValue("releaseId", "-1"));

    // Chart parameters
    request.setAttribute("daysToShow", request.getPreferences().getValue("daysToShow", "45"));
    request.setAttribute(
        "estimatedHours", request.getPreferences().getValue("estimatedHours", "0.0"));
    request.setAttribute("workHours", request.getPreferences().getValue("workHours", "7.0"));
    request.setAttribute("chartHeight", request.getPreferences().getValue("chartHeight", "250"));

    // Show the edit page
    PortletContext context = getPortletContext();
    PortletRequestDispatcher requestDispatcher = context.getRequestDispatcher(EDIT_PAGE);
    requestDispatcher.include(request, response);
  } catch (Exception e) {

  }
}

/** @throws Exception */
@Test
public void testCombine15s() throws Exception {
  SimpleDateFormat timeFormat = CommonDateOperations.getDateTimeFormat();
  Date time1 = timeFormat.parse("20090211-1100");

  Date time2 = timeFormat.parse("20090211-1105");
  AvailableBlock block1 = AvailableBlockBuilder.createSmallestAllowedBlock(time1);
  assertEquals(time2, block1.getEndTime());

  AvailableBlock block2 = AvailableBlockBuilder.createSmallestAllowedBlock(time2);
  SortedSet<AvailableBlock> smallBlocks = new TreeSet<AvailableBlock>();
  smallBlocks.add(block1);
  smallBlocks.add(block2);

  Set<AvailableBlock> combined1 = AvailableBlockBuilder.combine(smallBlocks);
  assertEquals(1, combined1.size());
  AvailableBlock expected =
      AvailableBlockBuilder.createBlock(block1.getStartTime(), block2.getEndTime());
  assertTrue(combined1.contains(expected));
}

