    XPath xpath = XPathFactory.newInstance().newXPath();

    String datestr = (String) xpath.evaluate("/update/date", doc, XPathConstants.STRING);

    SimpleDateFormat sdf = new SimpleDateFormat("yyyyMMdd hhmm");
